METADATA:{"created":"2026/01/01 03:07:44","modified":"2026/01/01 11:37:36"}

NOTE BLOCK CONTENT:

<%*
Const exts = ["png","jpg","jpeg","webp","tif","tiff"];
const files = app.Vault.GetFiles (). Filter (f => exts.Includes (f.extension));

Const target = await tp.System.Suggester (
  (f) => f.path,
  Files,
  False,
  "Pick an image to OCR"
);

const lang = await tp.System.Prompt ("Tesseract language (e.g. eng, chi_tra, eng+chi_tra)", "eng");

Const out = await tp.User.Ocr ({ ocr_input: target. Path, lang: lang });

TR += out;
%>

